import React from 'react';
import "../App.css";


function Navigation() {
    return (
        
        <div className="Navigation">
            <div className="leftSide">
               
            <div class="nav flex-column nav-pills desktop desktop-rel" 
            role="tablist" id="menu-options" aria-orientation="vertical">
                <a href="/" id="menuCategory_1" data-value="1" data-toggle="pill" class="active">Main Course</a>
                <a href="/" id="menuCategory_16" data-value="16" data-toggle="pill">Combo Offers</a></div>
  
        </div>
            
           
            
        </div>
    )
}

export default Navigation
